)c([ID],[Name],[Settings],[CreatedTime],[LastModifiedTime],[MeasureStyles]))
merge	[Analytic].[AnalyticTable] as t
using	cte_data as s
on		1=1 and t.[ID] = s.[ID]
when matched then
	update set
	[Name] = s.[Name],[Settings] = s.[Settings],[CreatedTime] = s.[CreatedTime],[LastModifiedTime] = s.[LastModifiedTime],[MeasureStyles] = s.[MeasureStyles]
when not matched by target then
	insert([ID],[Name],[Settings],[CreatedTime],[LastModifiedTime],[MeasureStyles])
	values(s.[ID],s.[Name],s.[Settings],s.[CreatedTime],s.[LastModifiedTime],s.[MeasureStyles]);




