)c([ID],[TableId],[ItemType],[Name],[Title],[Config],[CreatedTime],[LastModifiedTime]))
merge	[Analytic].[AnalyticItemConfig] as t
using	cte_data as s
on		1=1 and t.[ID] = s.[ID]
when matched then
	update set
	[TableId] = s.[TableId],[ItemType] = s.[ItemType],[Name] = s.[Name],[Title] = s.[Title],[Config] = s.[Config],[CreatedTime] = s.[CreatedTime],[LastModifiedTime] = s.[LastModifiedTime]
when not matched by target then
	insert([ID],[TableId],[ItemType],[Name],[Title],[Config],[CreatedTime],[LastModifiedTime])
	values(s.[ID],s.[TableId],s.[ItemType],s.[Name],s.[Title],s.[Config],s.[CreatedTime],s.[LastModifiedTime]);



