)c([ID],[UserID],[Name],[AccessType],[Settings],[CreatedTime],[LastModifiedTime]))
merge	[Analytic].[AnalyticReport] as t
using	cte_data as s
on		1=1 and t.[ID] = s.[ID]
when matched then
	update set
	[UserID] = s.[UserID],[Name] = s.[Name],[AccessType] = s.[AccessType],[Settings] = s.[Settings],[CreatedTime] = s.[CreatedTime],[LastModifiedTime] = s.[LastModifiedTime]
when not matched by target then
	insert([ID],[UserID],[Name],[AccessType],[Settings],[CreatedTime],[LastModifiedTime])
	values(s.[ID],s.[UserID],s.[Name],s.[AccessType],s.[Settings],s.[CreatedTime],s.[LastModifiedTime]);



